import React from 'react';
import { Redirect } from "react-router-dom";

function Auth(props) {
  return <CheckRedirect redirect = {props.redirect} />;
}
 
function CheckRedirect(props) {
  if(props.redirect)
  {
    return <Redirect to='/home' />
  }
  else
  {
    return <div></div>
  }
 
  
}
 
export default Auth;
